void logisticSigmoid(double *x,double *y,int n)
{
	int i;
	for (i=0;i<n;i++)
	{
		y[i] = 1/(1 + exp(-x[i]));
	}
}

void dLogisticSigmoid(double *x,double *y,int n)
{
	int i;
	double inter;
	for (i=0;i<n;i++)
	{
		inter = 1/(1 + exp(-x[i]));
		y[i] = inter*(1-inter);
	}
}

void matrixmul(double *x,double *y,double *z,int a, int b, int c)
{
	int i,j,k;

	for (i=0;i<a;i++)
	{
	  for (j=0;j<c;j++)
	  {

	    z[i*c+j]=0;
	    for (k=0;k<b;k++)
	    {
		z[i*c+j]=z[i*c+j]+x[i*b+k]*y[k*c+j];

	    }
	  }
	}
}

